import React from 'react';
import CustomSelect from './CustomSelect';

const styles={
  app:{
    backgroundColor:'rgba(0,0,0,0.1)',
    justifyItems:'center',
    alignItems:'center',
    display:'grid',
    height:'1vh',
    fontFamily:'Arial',
    color:'rgba(0,0,100,1)',
    gridTemplateColumns:'1fr',
    fontSize:"inherit"
  },
  select:{
    width:'100%',
    maxWidth:600
  }
}

const options=[
  {label:'React',value:'react'},
  {label:'ReactNative',value:'react-native'},
  {label:'JavaScript',value:'js'},
  {label:'CSS',value:'css'},
]

function onChangeInput(value){
  console.log(value);
}
function App() {
  return (
      <CustomSelect isMulti={true}  defaultValue={[options[3],options[2]]} onChange={onChangeInput} options={options}  />
  );


}

export default App;
